import logo from './logo.svg';
import React from "react";
import './App.css';
import {
  Dropdown,
  DropdownButton,
  Container,
  Row,
  Col,
  Modal,
  Button
} from "react-bootstrap";
import axios from "axios";


const apiUrl="http://ec2-3-88-109-250.compute-1.amazonaws.com/api"


class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      searched:''
    }
    this.lookForCar = this.lookForCar.bind(this);
  }

  lookForCar(){
    var inputVal = document.getElementById("search"); 
      if(inputVal != null){
      var doc = document.getElementById(inputVal.value);
        if (doc !== null) {
         doc.classList.add("blink");
         setTimeout(function(){
          doc.classList.remove("blink");
       }, 5000);
        }
      }
  }




render(){
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
        <input id="search" class="form-control mr-sm-2 auxNig" type="text"  placeholder="Search for a Car"  />    
        <Button  id="countryFinderButton" onClick={this.lookForCar}></Button>
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );}
}

export default App;
